import React from "react";
import Header from '../components/Header';
import Sidebar from "../components/Sidebar";
import User from '../images/usersicon.png';
function Dashboard() {
      return (

      <div>
                   <Header />
                   <Sidebar />
            <div className="dashboard">
                   <div className="col-md-12">
                        User
                   </div>
                   <div className="row">
                        <div className="col-md-12">
                              <div className="row">
                              <div className="col-md-3">
                                    <div className="card dash-widget shadow" >
                                        <div className="card-body"><span className="dashWidgetIcon">
                                         <img className="img_class pull_left" src={User} alt="logo"  />
                                        </span>     
                                    </div>
                                </div>
                            </div>
                              </div>
                        </div>
                  </div>
            </div>
      </div>
      );
  }

 export default Dashboard;
